    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE ( col2 ) NOT BETWEEN NULL AND col0 + + col1 + - col2 + - 49;
  - name: tab1

outputs:
  - name: q763.out
    data: |
      51	14	96
      85	5	59
      91	47	68
